import {Link} from 'react-router-dom'
import {Slot} from '@croct/plug-react';
function developer(){
    return (
      <Slot id="home-banner">
      <div>
      <strong>{title}</strong>
                        <p>{subtitle}</p>
                        <a href={cta.link}>{cta.label}</a>
        <Link to="/">
        <button>Voltar</button></Link>
        </div>
        </Slot>
    );
  }
export default developer;
